(function($) {
	$(document).ready(function(){
		$("form.cart").submit(function(){

			if( $('body').hasClass('.input-name') ){
			count_text = $(".input-name input[type='text']").val().length;
			if(count_text <= 0) {
				$('.input-name').append('<div class="gfield_description validation_message">Esse campo é obrigatório.</div>');
				return false;
			}
			}

			select_variation = $("#select2-pa_modelo-smartphone-container").attr('title');

			console.log(select_variation);
            
            if(select_variation == "Escolha uma opção") {

                	$('.error-message-select').remove();

            	$('html, body').animate({

			        scrollTop: $("#pa_modelo-smartphone").offset().top
			    }, 800);
            	$('.select2-selection.select2-selection--single').append('<p class="error-message-select">Esse campo é obrigatório.</div>');

            	$('#select2-pa_modelo-smartphone-container').addClass('error-select');
            	return false;
            }

			
		});
		$(".input-minus").click(function(e){
			value = $(this).next().val();
			if(value <= 0) {
				value = value;
			}else {
				value--;
			}
			$(this).next().val(value);
			$(this).next().trigger("change");
			e.preventDefault();
		});

		$(".input-more").click(function(e){
			value = $(this).prev().val();
		
				value++;
			
			$(this).prev().val(value);
			$(this).prev().trigger("change");
			e.preventDefault();
		});



	  $(document).ready(function() {
        
        $(".search-mobile").click(function(e){
        	$status = $('.search-header-container').attr('data-active');
        	if($status === 'false') {
        		$('.search-header-container').addClass('search-active');
        		$('.search-header-container').attr('data-active', 'true');
        	}else {
        		$('.search-header-container').removeClass('search-active');
        		$('.search-header-container').attr('data-active', 'false');
        	}
        	e.preventDefault;
        }); 

		$(".wc-default-select").select2();
		$(".variations select").select2();

		$("#calc_shipping_state").select2();
		$('.dropdown-toggle').dropdown();
	  });
	  
	  $('.product_type_variable.add_to_cart_button').html('Comprar');

	  $(".carousel-products .products").addClass('owl-carousel');

	  $(".single-product .related .products").addClass('owl-carousel');

	  $(".owl-carousel").owlCarousel({
	    items:5,
	    loop:true,
	    margin:10,
	    nav: true,
	    navContainerClass : 'navigation-carousel',
	    responsive : {
		    // breakpoint from 0 up
		    0 : {
		        items : 2,
		    },
		    480 : {
		        items : 2,
		    },
		    // breakpoint from 768 up
		    768 : {
		        items : 3,
		    },
		    980 : {
		        items : 5,
		    }
		}
	  });
	});
})(jQuery);

